    "Learning Units": [
      "LU1: Introduction to GitHub Copilot",
      "LU2: Practical Applications of GitHub Copilot"
    ]
  },
  "Assessment Methods": {
    "Assessment Methods": [
      "Written Assessment",
      "Practical Performance"
    ],
    "Amount of Practice Hours": "N.A.",
    "Course Outline": {
      "Learning Units": {
        "LU1": {
          "Description": [
            {
              "Topic": "Topic 1: Getting Started  with Github Copilot (K1, K3, A1, A3)",
              "Details": [
                "What is Github Copilot?",
                "How Github Copilot enhances software development efficiency?",
                "Install Github Copilot on Visual Studio Code",
                "Explore Github Copilot features"
              ]
            }
          ]
        },
        "LU2": {
          "Description": [
            {
              "Topic": "Topic 2: Software Development with Github Copilot (K2, K4, A2, A4)",
              "Details": [
                "Github Copilot for HTML",
                "Github Copilot for Python",
                "Github Copilot for Javascript",
                "Github Copilot for REST API",
                "Other emerging AI tools for software development"
              ]
            }
          ]
        }
      }
    },
    "Instructional Methods": "Classroom, Didactic Questioning, Demonstration, Practical"
  },
  "Survey Responses": [
    {
      "What are the performance gaps in the industry?": "In the current landscape, many organizations face challenges in their programming workflows, often resulting in inefficiencies and delays. The lack of integration of advanced tools leads to repetitive tasks and a slower development cycle, which can hinder innovation and responsiveness to market demands.",
      "Why do you think this WSQ course will address the training needs for the industry?": "This course equips participants with the skills to identify inefficiencies in their programming processes and leverage AI-assisted tools to enhance productivity. By exploring practical applications of GitHub Copilot, attendees will learn to streamline coding practices, ultimately fostering a more agile development environment."
    },
    {
      "What are the performance gaps in the industry?": "Organizations often struggle with outdated coding practices and insufficient knowledge of emerging technologies, which can lead to suboptimal software development outcomes. This gap not only affects productivity but also limits the ability to innovate and adapt to new technological trends.",
      "Why do you think this WSQ course will address the training needs for the industry?": "The course provides a comprehensive introduction to GitHub Copilot, enabling participants to explore its capabilities in various programming languages. By applying these tools, they can enhance their coding processes and stay updated with the latest technological advancements, thus addressing the skills gap in the industry."
    },
    {
      "What are the performance gaps in the industry?": "A significant performance gap exists in the ability to effectively utilize modern programming tools, which can lead to inefficiencies and increased error rates in software development. Many teams lack the necessary training to integrate AI tools into their workflows, resulting in missed opportunities for optimization.",
      "Why do you think this WSQ course will address the training needs for the industry?": "This course focuses on practical applications of AI programming tools, allowing participants to gain hands-on experience with GitHub Copilot. By understanding how to implement these tools effectively, they will be better equipped to propose solutions that enhance their organization's coding efficiency and overall productivity."
    }
  ]
}

